MEDINA, Mar 06 (APP): Deputy Prime Minister and Foreign Minister Senator Mohammad Ishaq Dar arrived in Medina al-Munawwarah on Thursday.
He offered prayers at the Masjid-e-Nabawi ﷺ, seeking the welfare, prosperity, and progress of Pakistan and the Muslim Ummah.
